import {Footer} from './components/footer'
import {Header} from './components/header'

import RouteSwitch from './RouteSwitch';
import { createContext, useState } from 'react';

export const myCart = createContext(0);
export const first = createContext(false);

function App() {
  const [MyCarts, setMyCarts] = useState(0);
  const [firsty, setFirsty] = useState(false)

  return (
    <>
    <myCart.Provider value={MyCarts}>
      <first.Provider value={firsty}>
        <Header />
          <RouteSwitch />
        <Footer />
      </first.Provider>
    </myCart.Provider>
    </>
  );
}

export default App
export const bag = createContext([]);
